import React from "react";
import PropTypes from "prop-types";
import { Menu } from "antd";
import Link from "next";

const AppLayout = ({ children }) => {
  return (
    <Menu mode="horizontal">
      <Menu.Item key="home"><Link href="/"><a>메인화면</a></Link></Menu.Item>
      <Menu.Item key="profile"><Link href="/porfile"><a>프로필</a></Link></Menu.Item>
      <Menu.Item key="signup"><Link href="/"><a>회원가입</a></Link></Menu.Item>
      <div>{children}</div>
    </Menu>
  );
};

AppLayout.propTypes = {
  children: PropTypes.node.isRequired,
};

export default AppLayout;
